export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},vTiwme7CbT:{data:{id:123,attributes:{imdbId:"tt0164334",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BOTVlY2VhMWEtYmRlOC00YWVhLWEzMDktZWJlYzNiMWJmZTIwXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"32%"},{Source:"Metacritic",Value:"42\u002F100"}],item_lang:{data:{id:786,attributes:{title:c,plot:"Detective\u002Fpsychologist Alex Cross loses his partner in an out of control 'bust.' He stops working and cannot forgive himself. He is drawn back to work reluctantly when a senator's daughter is kidnapped and the kidnapper seems to want to deal with Alex personally.",slug:"along-came-a-spider"}}},books:{data:[{id:2224,attributes:{title:c,description:i,thumbnail:j,authors:[a],firstBook:true,published:k,publisher:e,subtitle:f}},{id:2225,attributes:{title:c,description:"The legendary thriller that launched the international Alex Cross phenomenon _________________________________ 'No one gets this big without amazing natural storytelling talent - which is what Jim has, in spades. The Alex Cross series proves it.' LEE CHILD, international bestselling author of the Jack Reacher series _________________________________ Two children have been kidnapped from an elite Washington D.C. private school. Detective Alex Cross must find them. The kidnapper's identity is quickly determined as the students' maths teacher, Gary Soneji, but capturing him is the true challenge. Alex's pursuit of the sinister Soneji escalates, and it becomes increasingly clear that he's something far more dangerous. Alex discovers that the crime runs deeper and begins to uncover connections that no one could have anticipated. Adapted as a major Hollywood movie starring Morgan Freeman",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-D-gDQAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2017-01-01",publisher:"Random House",subtitle:"(Alex Cross 1)"}},{id:2226,attributes:{title:c,description:i,thumbnail:j,authors:[a],firstBook:d,published:k,publisher:e,subtitle:f}},{id:2227,attributes:{title:"Kill Alex Cross",description:"Detective Alex Cross is thwarted at every turn while he attempts to investigate the abduction of the President's son and daughter and also discovers a deadly contagion released in the Capitol's water supply that foreshadows of a larger, more devastating attack. Reprint. 1.1 first printing.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3a7anQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2012-11-20",publisher:"Vision",subtitle:f}},{id:2228,attributes:{title:"Kiss the Girls",description:"Join Alex Cross on his most terrifying murder case yet in this #1 New York Times bestseller and one of PBS's \"100 Great American Reads.\" In Los Angeles, a reporter investigating a series of murders is killed. In Chapel Hill, North Carolina, a beautiful medical intern suddenly disappears. In the sequel to Along Came a Spider, Washington D.C.'s Alex Cross is back to solve the most baffling and terrifying murder case ever. Two clever pattern killers are collaborating, cooperating, competing-and they are working coast to coast.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=lEWgCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2002-12-11",publisher:e,subtitle:"A Novel by the Author of the Bestselling Along Came a Spider"}}]}}},meta:{}}},prerenderedAt:1681377188188}}("James Patterson","movie","Along Came a Spider",null,"Hachette UK","","series",1,"Discover the classic thriller that launched the #1 detective series of the past twenty-five years, now one of PBS's \"100 Great American Reads\" Alex Cross is a homicide detective with a Ph.D. in psychology. He works and lives in the ghettos of D. C. and looks like Muhammad Ali in his prime. He's a tough guy from a tough part of town who wears Harris Tweed jackets and likes to relax by banging out Gershwin tunes on his baby grand piano. But he also has two adorable kids of his own, and they are his own special vulnerabilities. Jezzie Flanagan is the first woman ever to hold the highly sensitive job as supervisor of the Secret Service in Washington. Blond, mysterious, seductive, she's got an outer shell that's as tough as it is beautiful. She rides her black BMW motorcycle at speeds of no less than 100 mph. What is she running from? What is her secret? Alex Cross and Jezzie Flanagan are about to have a forbidden love affair-at the worst possible time for both of them. Because Gary Soneji, who wants to commit the \"crime of the century,\" is playing at the top of his game. Soneji has outsmarted the FBI, the Secret Service, and the police. Who will be his next victim? Gary Soneji is every parent's worst nightmare. He has become Alex Cross's nightmare. And now, reader, he's about to become yours.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=b0WgCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2001-02-15"))